svg.script:
    var src, dst, trl;

    function init() {
	    location.reload();
    }


    function clickSrc(evt) {

   	var tgt = evt.target;
   	var txtLgd;
	if(!src){
    	src=tgt;
    	txtLgd = "txtSrc"
    }else{
		if(!dst){
	    	dst = tgt;
	    	txtLgd = "txtDst"
	    }else{
			trl = tgt;	    
	    	txtLgd = "txtTrl"
	    }
    }
    	
    var arrId = tgt.getAttribute("id").split("_");
    
	var id,class;
	//met à jour les pavés seulement dans le cas du choix d'une primitive
	if(arrId.length==2){
		for (var i = 1; i <= 6; i++) {
			//récupère l'identifiant du pavé
			id = 'g_'+arrId[1]+'_'+i;
			//modifie la class du pavé
			if(document.getElementById(id).getAttribute("class")=="styleI")
				class = 'style'+arrId[1]+'dst';
			else
				class = 'styleI';
			document.getElementById(id).setAttribute("class",class);
	
		}
	}
	 
   	var tgt = evt.target;
   	var txtLgd;
	if(!src){
    	src=tgt;
    	txtLgd = "txtSrc"
    }else{
		if(!dst){
	    	dst = tgt;
	    	txtLgd = "txtDst"
	    }else{
			trl = tgt;	    
	    	txtLgd = "txtTrl"
	    }
    }
	//mis à jour du texte
    document.getElementById(txtLgd).firstChild.data=tgt.getAttribute("iemlCode");

    alert(tgt.getAttribute("id"));
    //alert(src.getAttribute("iemlCode"));
	
    }
    function clickChoix(evt) {
	 		var tgt = evt.target;
	 		alert(tgt.getAttribute('id'));
	 		if(tgt.getAttribute('id')=="g_M"){
	 			class = 'styleDesPrim';
				document.getElementById('g_U').setAttribute("class",class);
	 		    document.getElementById('g_A').setAttribute("class",class);
	 		    document.getElementById('g_U').setAttribute("onclick","");
	 		    document.getElementById('g_A').setAttribute("onclick","");
	 		    document.getElementById('g_S').setAttribute("class","styleSsrc");
		 		document.getElementById('g_B').setAttribute("class","styleBsrc");
		 		document.getElementById('g_T').setAttribute("class","styleTsrc");
		 		document.getElementById('g_S').setAttribute("onclick","clickSrc(evt)");
		 		document.getElementById('g_B').setAttribute("onclick","clickSrc(evt)");
		 		document.getElementById('g_T').setAttribute("onclick","clickSrc(evt)");
	 		}else
	 			if(tgt.getAttribute('id')=="g_O"){
		 			class = 'styleDesPrim';
					document.getElementById('g_S').setAttribute("class",class);
		 		    document.getElementById('g_B').setAttribute("class",class);
		 		    document.getElementById('g_T').setAttribute("class",class);
		 		    document.getElementById('g_S').setAttribute("onclick","");
		 		    document.getElementById('g_B').setAttribute("onclick","");
		 		    document.getElementById('g_T').setAttribute("onclick","");
		 		    document.getElementById('g_U').setAttribute("class","styleUsrc");
	 		        document.getElementById('g_A').setAttribute("class","styleAsrc");
	 		        document.getElementById('g_U').setAttribute("onclick","clickSrc(evt)");
	 		        document.getElementById('g_A').setAttribute("onclick","clickSrc(evt)");
	 	        }
	 }
